import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link, Redirect } from 'react-router-dom';
import MainPage from './pages';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/' component={MainPage} />
      </Switch>
    </Router>
  );
}

export default App;
